import React from 'react';
import useCollection from '../hooks/useCollection';
import useProvider from '../hooks/useProvider';

const Home = () => {
  const { user } = useProvider();
  const { documents } = useCollection();

  return <div>Hello , {user && user.email}</div>;
};

export default Home;
